import Grid from '@material-ui/core/Grid';
import { makeStyles } from '@material-ui/core/styles';
import { Typography } from '@material-ui/core';

const useStyles = makeStyles( ( theme ) => ( {
    heading: {
        flexGrow: 1,
        textAlign: 'center',
        fontFamily: `'Frank Ruhl Libre', serif`,
    },
    root: {
        margin: '5em auto',
    }

} ) );

export default function HomePage()
{
    const classes = useStyles();

    return (
        <Grid container className={classes.root} spacing={2}>
            <Grid item sm={12} >
                <Typography className={classes.heading} variant="h2" component="h2">
                    מערך הקניות החכם של EzBuy
</Typography>
                <Typography className={classes.heading} variant="h5" component="h2">
                    הרעיון הוא ליצור אקוסיסטם מקומי ברמת מתחמי הקניות,
                     <br />
                    בהם בתי העסק משתתפים לקבלת שירות של חנות וירטואלית במודל של אמאזון.
                    זה הבסיס, אבל החידוש הוא במערכת השילוח ללקוחות תוך שימוש במערכות לוקרים חכמים הממוקמים בנקודות אסטרטגיות בנקודות המוצא והיעד של המוצר
</Typography>

            </Grid>
        </Grid>
    );
}
